import './photography.scss';

function importAll(src) {
  let images = {};
  src.keys().map((item, index) => {
    images[item.replace('./', '')] = src(item);
  });
  return images;
}

const images = importAll(require.context('../../assets/Photography/photos', false, '/\.png/'));

function Photography() {

  return (

    <div className="Photography">
      Photography!<br/>

      <div className="grid-item"><img src={images['Seoul.jpg']} /></div>


    </div>
  )
}


export default Photography
